import { Component, OnInit } from '@angular/core';
import { AngularFireStorage } from '@angular/fire/compat/storage';
import { AngularFirestore } from '@angular/fire/compat/firestore';
import { ToastController } from '@ionic/angular';
import { AddMedecin } from  'src/firebaseConfig'; // Assurez-vous d'importer AddMedecin correctement

@Component({
  selector: 'app-signup-medecin',
  templateUrl: './signup-medecin.page.html',
  styleUrls: ['./signup-medecin.page.scss'],
})
export class SignupMedecinPage implements OnInit {

  selectedFile: File | null = null;
  selectedFileUrl: string | null = null;

  selectedState: string | null = null;
  selectedDelegation: string | null = null;










  familyName = "";
  name = "";
  email = "";
  password = "";
  date = "";
  sexe = "";
  localisation = "";
  specialite = "";
  role = "medecin";
  telephone = "";

  constructor(
    private firestore: AngularFirestore,
    private storage: AngularFireStorage,
    private toastController: ToastController
  ) { }

  onStateChange() {
    // Réinitialiser la délégation sélectionnée lorsque l'état change
    this.selectedDelegation = null;
  }

  onFileSelected(event: any) {
    const file: File | null = event.target.files[0];
    if (file) {
      this.selectedFile = file;
      this.selectedFileUrl = URL.createObjectURL(this.selectedFile); // Obtenez l'URL de l'image sélectionnée
      console.log("url image", this.selectedFileUrl);
    }
  }

  async presentToast(message: string) {
    const toast = await this.toastController.create({
      message: message,
      duration: 3000,
      position: 'bottom',
    });
    toast.present();
  }

  ngOnInit() {}

  async AddUser() {
    try {
      const file = this.selectedFile;
      await AddMedecin(
        this.firestore,
        this.storage,
        this.familyName,
        this.name,
        this.email,
        this.password,
        this.date,
        this.sexe,
        this.role,
        this.specialite,
        this.localisation,
        this.telephone,
        file
      );
      this.presentToast('Registration successful!');
      this.resetForm(); // Réinitialiser le formulaire après l'ajout réussi
    } catch(error) {
      console.log('Error during registration:', error);
      this.presentToast('Error during registration.');
    }
  }

  resetForm() {
    this.familyName = '';
    this.name = '';
    this.email = '';
    this.password = '';
    this.localisation = '';
    this.specialite = '';
    this.date = '';
    this.sexe = '';
    this.telephone = '';
    this.selectedFile = null;
  }
}
